import React, { Component } from "react";
import Slider from "react-slick";
import 'slick-carousel/slick/slick.css'
import 'slick-carousel/slick/slick-theme.css'
import h2 from './images/h2.jpg'
import h4 from './images/h4.jpg'
import h6 from './images/greens.jpeg'
import './App.css'



export default class SimpleSlider extends Component {
  render() {
    const settings = {
        dots: true,
        infinite: false,
        speed: 500,
        slidesToShow: 4,
        slidesToScroll: 4,
        initialSlide: 0,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 3,
              infinite: true,
              dots: true
            }
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
              initialSlide: 2
            }
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1
            }
          }
        ]
      };
  
    return (
        <Slider {...settings}>
          
          <div style={{ width: 100,height:100 }}>
          <img src={h2} alt="" />
          </div>
          
          <div style={{ width: 100,height:100 }}>
          <img src={h4} alt="" />
          </div>
          
          <div style={{ width: 100,height:100 }}>
          <img src={h6} alt="" />
          </div>
          <div style={{ width: 100,height:100 }}>
          <img src={h4} alt="" />
          </div>
        </Slider>
    );
  }
}
